休日の土曜日。

昨日は本当に体調が悪かった。
ランチ前くらいから
光が眩しいとは思っていて
PCグラスかけてたけども
夜は音がうるさくて煩くてウルサクテ
頭痛と腰痛と腹痛と肩こりで
大変だった。

鉄を飲み忘れたせいだと思うけど
こんなに辛い月久しぶりだった。
1週間前から1日1粒
当日から1日2粒でだいぶ楽になったのに。
雨だし、暑いしってのもあるだろうけど
久しぶりに立ってられないレベルだった。

というわけで
昨日寝る前に3粒目の鉄を摂取して
10時まで10時間睡眠。
7時間+二度寝と三度寝なんだけどね。

大学生のとき初めて
「光が眩しい」「音が煩い」を経験して
未だに1年に1回くらいなるけど
【真っ暗な部屋で音すべてを消して寝る】
しか解決方法ない。

今日は動き全てスローで
やりたいことをのんびりやってる。

幸い
頭痛いのも体がだるいのも
今日は割と平気。
でも、パフェ食べたいと思うくらいには
まともじゃないかもしれない。
私が、パフェ。
ひとりで、ちょっと笑う。
